import { createStore } from 'redux';
import { CounterRedux } from '../counterRedux';
import Store from './store';

Store.dispatch({ type:'counter/increment'})
Store.dispatch({ type:'counter/increment'})
Store.dispatch({ type:'counter/increment'})
Store.dispatch({ type:'counter/dicriment'})
